import React, { Component } from 'react'

export default class Snap extends Component {
    constructor(props) {
        super(props);
        this.state ={
            Snap: null,
        }
    }


    componentDidMount() {
        this.setState({Snap: require('snapsvg')})
    }

    render() {
        return this.state.Snap
    }
}
